```', 'comment_created': datetime.datetime(2020, 6, 1, 16, 50, 29, tzinfo=datetime.timezone.utc), 'commenter': 'ncw', 'type': 'User'}, {'comment_id': 435925864, 'comment_body': 'the mount fns mutex needs to be locked here', 'comment_created': datetime.datetime(2020, 6, 5, 13, 37, 8, tzinfo=datetime.timezone.utc), 'commenter': 'ncw', 'type': 'User'}, {'comment_id': 435928529, 'comment_body': "I would just have 1 mutex to protect both maps otherwise you'll get confused about which one you've got locked!

It is traditional in go code to call them `mu` or `somethingMu` so lets say it is called `mountsMu`.

It is also traditional to define them **before** the things they protect, so I think this block should look like

```go
    // mutex to protect all the variables in this block
    mountMu sync.Mutex
    // Mount functions available
    mountFns = map[string]MountFn{}
    // Map of mounted path => MountInfo
    liveMounts = map[string]MountInfo{}
```", 'comment_created': datetime.datetime(2020, 6, 5, 13, 41, 24, tzinfo=datetime.timezone.utc), 'commenter': 'ncw', 'type': 'User'}, {'comment_id': 435929306, 'comment_body': "for more complicated functions it is easiest just to write this for locking purposes

```go
    mountMu.Lock()
    defer mountMu.Unlock()
```

That will mean that the mutex is unlocked on function exit regardless. It is easy to audit and in go1.14 and later there is no performance penalty for using defer like this.

It is really super easy to mess locking up (I speak from lots of experience messing it up here!) so keeping it simple is best. I'd probably use this form on all your functions then you and I don't need to worry about it!", 'comment_created': datetime.datetime(2020, 6, 5, 13, 42, 37, tzinfo=datetime.timezone.utc), 'commenter': 'ncw', 'type': 'User'}, {'comment_id': 435947758, 'comment_body': 'Ahh.. This looks easier :p
